    if (isObject(type)) {
      processComponent(n1, n2, container, isSVG)
    } else if (isString(type)) {
      processElement(n1, n2, container, isSVG)
    } else if (isTextType(type)) {
      processText(n1, n2, container)
    } else {
      type.process(/* ... */)
    }
  }

